import React from 'react';
import { NavLink } from 'react-router-dom';
import PropTypes from 'prop-types';

function Navbar() {
  return(
    <nav class="navbar shadow-nav bg-green navbar-expand fixed-bottom">
      <ul class="navbar-nav nav-justified w-100">
        // <li class="nav-item">
        //   <a href="/" class="nav-link active"><span class="material-icons size-34">
        //   search
        //   </span></a>
        // </li>
        // <li class="nav-item">
        //   <a href="/article" class="nav-link"> <span class="material-icons size-34">
        //     explore</span></a>
        // </li>
        <NavLink to="/">
          <span class="material-icons size-34">
          search
          </span>
        </NavLink>
        <NavLink to="/article">
          <span class="material-icons size-34">
            explore</span>
        </NavLink>
      </ul>
    </nav>
  );
}

export default Navbar;
